import { useState } from "react"


const AddPerson = props => {

    const[name, setName] = useState('')
    const[gender, setGender] = useState('')
    const[age, setAge] = useState('')
    const[money, setMoney] = useState('')
    const[height, setHeight] = useState('')



  return (
    <form>
        <label>Name:
            <input type="text" onChange={e=>setName(e.target.value)} value={name}/>
        </label>
        <label>Gender:
            <input type="text" onChange={e=>setGender(e.target.value)} value={gender}/>
        </label>
        <label>Age:
            <input type="text" onChange={e=>setAge(e.target.value)} value={age}/>
        </label>
        <label>Money:
            <input type="text" onChange={e=>setMoney(e.target.value)} value={money}/>
        </label>
        <label>Height:
            <input type="text" onChange={e=>setHeight(e.target.value)} value={height}/>
        </label>
        <input type='submit' ></input>
    </form>
  )
}

export default AddPerson
